import React from "react";
import "./about.css";

const About = () => {
  return (
    <div>
      <h1>This is my about page.</h1>
      <p>
        We want to deliver the quality that is unbeatable in Washingron area.
        Our principle is to focus on the training of recent nail schools
        graduets, so they are always up to date with the newest board exam
        preparation information. We believe in strong management and continuous
        self-development. We want to help you to celebrate yourself in your
        real, most raw, authentic brilliance, who believes in yourselves and are
        ready to step into the carier you love.
      </p>
    </div>
  );
};

export default About;
